package contest

import (
	"math"
)

// 贝壳双周赛

// 1.计算勾股数组个数
func countTriples(n int) int {
	res := 0
	for a := 3; a <= n; a++ {
		for b := 3; b <= n; b++ {
			dst := getSum(a, b)
			c := int(math.Ceil(math.Sqrt(float64(dst))))
			if c > n {
				break
			}
			if c <= n && c*c == dst {
				res++
			}
		}
	}
	return res
}

func getSum(a, b int) int {
	return a*a + b*b
}

