func nearestExit(maze [][]byte, entrance []int) int {
	m, n := len(maze), len(maze[0])
	total := m * n
	mazeInt := make([][]int, m)
	for i := range maze {
		mazeInt[i] = make([]int, n)
		for j := range mazeInt[i] {
			if maze[i][j] == '+' {
				mazeInt[i][j] = -1
			} else {
				mazeInt[i][j] = total
			}
		}
	}

	distance := subNearestExit(mazeInt, entrance[0], entrance[1], 0)
	if distance == total {
		return -1
	}

	return distance
}
func subNearestExit(maze [][]int, x, y int, step int) int {
	m, n := len(maze), len(maze[0])
	maze[x][y] = step
	step++

	minDistance := m * n
	if x > 0 && maze[x-1][y] > step {
		if x-1 == 0 || y == 0 || y == n-1 {
			return step
		}
		minDistance = min(minDistance, subNearestExit(maze, x-1, y, step))
	}
	if x < m-1 && maze[x+1][y] > step {
		if x+1 == m-1 || y == 0 || y == n-1 {
			return step
		}
		minDistance = min(minDistance, subNearestExit(maze, x+1, y, step))
	}
	if y > 0 && maze[x][y-1] > step {
		if y-1 == 0 || x == 0 || x == m-1 {
			return step
		}
		minDistance = min(minDistance, subNearestExit(maze, x, y-1, step))
	}
	if y < n-1 && maze[x][y+1] > step {
		if y+1 == n-1 || x == 0 || x == m-1 {
			return step
		}
		minDistance = min(minDistance, subNearestExit(maze, x, y+1, step))
	}
	return minDistance
}

func min(a, b int) int {
	if a <= b {
		return a
	}
	return b
}
